【商品説明】<br>ほんのり色づきランチ後もしっかり唇色キープ。ロングラスティング・美容液成分９０％配合。塗り易いフロッキーチップ。<br><br>成分：<BR>＊水添ポリイソブテン<br>＊トリイソステアリン酸ポリグリセリル－２<br>＊リンゴ酸ジイソステアリル＊ワセリン<br>＊ミネラルオイル＊ジメチルシリル化シリカ<br>＊テトラヘキシルデカン酸アスコルビル<br>＊トコフェロール＊アンズ核油＊スクワラン<br>＊イソステアロイル加水分解コラーゲン＊ローヤルゼリーエキス<br>＊ヒアルロン酸Ｎａ＊パルミチン酸デキストリン<br>＊ｔ－ブチルメトキシジベンゾイルメタン＊プロピルパラベン<br>＊トリ（カプリル酸／カプリン酸）グリセリル<br>＊ジメチコン＊イソ<br>問い合わせ先：<BR>03-3262-4061<br>原産国：日本<br>ブランド：ボンボン<BR>商品サイズ：95×163×19<br>JANコード：4970061018718<BR>cs：999<BR>商品カテゴリ： 化粧品・化粧小物 ＞ メイクアップ ＞ リップグロス　(040211)<br><br>区分：化粧品<br><br>発売元、製造元、輸入元又は販売元： 株式会社エリザベス<BR><BR>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
