【キャンメイク ユアリップオンリーグロス 02 パールの詳細】<br>
●唇の水分量によって色の変化や発色の強さが異なります。<br>
●発色には個人差があります。<br>
●時間とともに発色が強まり、色が唇に密着して落ちにくくなります。<br>
●ちょうどいいと思った時点でティッシュオフして、自分好みのナチュラルなツヤ感・血色感を出してね。<br>
●SPF15・PA+、美容エモリエント成分92％以上配合。<br><br>

【使用方法】<br>
●すっぴん風血色リップの作り方<br>
1.唇に一度塗りした後、時間を置きます。<br>
2.透明からピンクに変わる途中、ちょうどいい発色と思ったらティッシュなどで余計なグロスをオフ<br>
3.唇に潤いを残しつつ、ベタつきのない自然な血色リップの完成。<br><br>

【ご注意】<br>
○落ちにくい為、唇やお肌にピンク色が残る場合がございます。クレンジング（オイルやクリーム）でのメイク落としが必要となります。<br>
○衣服などについた場合、落ちにくいため、つかないようにご注意ください。<br>
○高湿度等環境の変化や使用中チップに付着した水分量によって、中身や容器がピンクに変化する場合がありますが、品質上に問題ございません。<br>
○ご使用後はティッシュペーパー等でチップを拭いてから、しっかりキャップを閉め衛生的にお使いください。<br><br>

【成分】<br>
リンゴ酸ジイソステアリル、水添ポリイソブテン、トリエチルヘキサノイン、メトキシケイヒ酸エチルヘキシル、ジメチルシリル化シリカ、t-ブチルメトキシジベンゾイルメタン、オクチルドデカノール、ジブチルラウロイルグルタミド、エチルパラベン、ジブチルエチルヘキサノイルグルタミド、トコフェロール、PET、ホウケイ酸(Ca/Al)、ポリエチレンイソテレフタレート、トリイソステアリン酸ポリグリセリル-2、赤218、酸化チタン<br><br>

【内容量】<br>
1本<br><br>

